import React from 'react';
const { default: axios } = require("axios")

export default class Person extends React.Component {

    state = {
        person: {
            gender: 'init'
        }
    }

    onClick = () => {
        console.log("resp")
        getPeople().then(resp => {
            this.setState({person: resp})
            console.log(resp.data)
        })
        console.log(this.state.person.gender)
    }

render() {
    return (
        <div className="person-details card">
        <img className="person-image"
            src="https://starwars-visualguide.com/assets/img/characters/3.jpg" />

        <div className="card-body">
            <h3>R2-D2</h3>
            <ul className="list-group list-group-flush">
            <li className="list-group-item">
                <span className="term">Gender: </span>
                <span>{this.state.person.gender}</span>
            </li>
            <li className="list-group-item">
                <span className="term">Birth Year: </span>
                <span>{this.state.person.birth_year}</span>
            </li>
            <li className="list-group-item">
                <span className="term">Eye Color: </span>
                <span>{this.state.person.eye_color}</span>
            </li>
            </ul>
        </div>
        <button onClick={this.onClick}>Next</button>
        </div>
    )
    }
}

function getPeople() {
    return axios.get('https://swapi.dev/api/people/3')
    // console.log(resp)
    // return {
    //     Gender: resp.gender,
    //     BirthYear: resp.birth_year,
    //     EyeColor: resp.eye_color
    // }
}


